    //State para el equipo
    const [equipo, guardarEquipo] = useState({
        isLogged: ''
    });

    //Extraer nombre del state equipo
    const {isLogged} = equipo;

    console.log(isLogged);

    function Greeting(){
        this.setState({isLogged: false});
    }

